const ApiTypeEnum = {
    GET: 'GET',
    POST: 'POST',
    LIST: 'LIST',
    DETAIL: 'DETAIL',
    CREATE: 'CREATE',
    UPDATE: 'UPDATE',
    DELETE: 'DELETE',
    API_CALL: 'API_CALL'
};

export default ApiTypeEnum;
